import React from "react";

import { DocumentTextIcon } from "@heroicons/react/solid";


const Resume = () => {
    // const googleDocUrl = "https://drive.google.com/file/d/1mKZscvkcaYH8RQYP4ZGTVAAzQT3AXUzV/view?usp=sharing";
    return (
      <div>
      <div  class="center-iframe">
      <DocumentTextIcon className="mx-auto inline-block w-10 mb-4" />
        <h1 className="sm:text-4xl text-3xl font-medium title-font mb-4 text-black">My Resume</h1>
      </div>
      <div class="center-iframe">
        <iframe src="https://drive.google.com/file/d/1mKZscvkcaYH8RQYP4ZGTVAAzQT3AXUzV/preview" width="600" height="720px" allow="autoplay"></iframe>
      </div>
      </div>
    );
  };

export default Resume;
